import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes.js";

function App() {
	return (
		<>
			<Header />
			{notes.map((note) => (
				<Note key={note.key} title={note.title} body={note.body} />
			))}
			<Footer />
		</>
	);
}
export default App;
